export default function QuestionList() {
  return (
    <div
      style={{
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
      }}
    >
      <div style={{ color: "white", fontWeight: "bold" }}>질문리스트</div>
      <div className="loader" style={{ margin: "15px 0" }}></div>
      <div style={{ padding: "5px" }}>
        <button
          style={{
            width: "87px",
            height: "27px",
            background: "#4e7ea8",
            color: "white",
            border: "none",
            borderRadius: "6px",
            cursor: "pointer",
          }}
        >
          메롱
        </button>
      </div>
    </div>
  );
}
